import React from "react";
import "./App.css";
import Menu from "./Menu.js";
import styled from "styled-components";
import Tooltip from '@material-ui/core/Tooltip';



const MainContainer = styled.div`
  display: grid;
  grid-template-rows: 1fr 2fr;
  width: 100%;
  height: 100vh;
`;
const StyledDiv1 = styled.div`
 display: flex;
 flex-direction: row;
 flex-wrap: wrap;
 justify-content: center;
  background-color: #ffffff;
  border: solid;
  border-color: #ECF39E;

`;

const Name = styled.h1`
  color: #474448;
  font-size: 5em;
  text-align: center;

`;


const StyledDiv2 = styled.div`

`;

const Cactus = styled.img`
width: 30vh;
height: 30vh;
`

const StyledToolTip = syled(Tooltip)`
background-color: #ECF39E;
color: #474448;
font-size: 1em;
`

function App() {
  return (

    <MainContainer>
      <StyledDiv1>

      <Name>KATHERINE SZELAG</Name>
      <Tooltip title="pretty fly for a cacti" placement="right" arrow>
      <Cactus alt="cactus" src="https://res.cloudinary.com/dpfixnpii/image/upload/v1583293953/kisspng-cactaceae-tumblr-plant-drawing-funny-cactus-5b376182835610.997629241530356098538_u7vg8w.png"/>
      </Tooltip>



      </StyledDiv1>
      <StyledDiv2>
        <Menu />
      </StyledDiv2>
    </MainContainer>
  );
}

export default App;

